namespace Elatebrain\GoogleMap\Block\Adminhtml\System\Config\Field;


/**
 *
 */
class AutoFillBtn extends \Magento\Config\Block\System\Config\Form\Field
{
    /**
     * @var string
     */
    protected $_template = 'Elatebrain_GoogleMap::config/form/field/autofillbtn.phtml';

    /**
     * @param \Magento\Framework\Data\Form\Element\AbstractElement $element
     * @return string
     */
    protected function _getElementHtml(\Magento\Framework\Data\Form\Element\AbstractElement $element)
    {
        $this->setElement($element);

        return $this->_toHtml();
    }
}